tenho pensado em como poderia colocar em um prato todo esse sentimento atrav\u00e9s de sabor!\n.\n.\nEspero que gostem! \ud83d\ude0b\ud83d\ude0b\ud83d\ude0b com certeza tem muito amor envolvido \u2764\u2764\u2764\n.\n.\nATEN\u00c7\u00c3O o Instagram s\u00f3 est\u00e1 mostrando as postagens para quem INTERAGIR, se voc\u00ea quer continuar recebendo del\u00edcias como essa todos os dias no seu Feed curta \ud83d\ude4f\u2764e comente SIM \ud83d\ude4f\ud83d\ude4b\u200d\u2640\ufe0f\ud83d\ude4b\u200d\u2640\ufe0f\n.\n.\nPesco\u00e7o de Peru na cerveja preta com fruta p\u00e3o!\n.\n2 kg pesco\u00e7o de peru (deixei na noite anterior temperado com vinho tinto, alho, sal, pimenta, loro, tomilho)\n.\n1 colher de Banha ou azeite\n.\n1 Cebola\n.\n1 dente de Alho\n.\n4 Tomate italiano sem pele e semente picadinho\n.\n2 latas de cerveja preta\n.\n500 ml de caldo de galinha\n.\n1 Piment\u00e3o vermelho picadinho\n.\nCoentro a gosto\n.\n1 fruta p\u00e3o cortada e cozida (pode ser substitu\u00edda por 1/2 kg de batata cortadas com casca)\n.\n.\nEu fritei os pesco\u00e7os com uma colher de banha, depois de bem fritos eu acrescentei a cebola e o alho. Refoguei bem e acrescentei o tomate.\nAcrescentei a cerveja e o caldo de galinha.\n.\n.\nComo eu cozinhei em uma panela o pesco\u00e7o ficou 2h30 no fogo! Ap\u00f3s ele estar bem macio eu coloquei o piment\u00e3o e a fruta p\u00e3o j\u00e1 cozida.\n.\n.\nDeixe a piment\u00e3o amolecer um pouquinho e j\u00e1 est\u00e1 pronto!!!\n.\n.\n.\n.\nSigam nosso perfil @momentostemperados\n.\n.\n#momentostemperados #goodvibes #panelaterapia #life #love #gastronomia #receitafacil #cozinhaterapia #receitasaudavel #cozinhasimples #tudogostoso #editorapanelinha #panelinha #ritalobo #amoremceber #nacozinha #cozinhatemperada #cozinhafacil #food #temperodefamilia #devoltaaobasico #testamadebrasil #testamade #receitas #comidadeverdade #receitascaseiras #instafood"}}]},"shortcode":"B9xf81al8d0","edge_media_to_comment":{"count":0},"taken_at_timestamp":15843163 ecar","id":"2265732583977537785","edge_media_to_caption":{"edges":[{"node":{"text":"Reposted from @jodywatley Nothing like the live experience with everyone together as one in the music.::: ALL upcoming shows have been cancelled or postponed, no bookings being accepted until further notice - health and wellness are of utmost importance during this pandemic. Love, good health and positive vibes to all until we see each other again in the live setting. I\u2019ll be writing more, reading more books I\u2019ve been wanting to get to working on projects (\u2018Spring\u2019 EP is done and being mixed..working on \u2018Summer\u2019 new collaboration w @theapxmusic \ud83d\ude80 \ud83c\udfb9\ud83c\udfb9), listening to lots of music, still getting my cardio and workouts at home, watch some NBA classics, documentaries.... doing more things I enjoy around the house, maybe I\u2019ll finish my memoir too ...times like these remind us not to take things for granted, that\u2019s why living in the moment is always important, especially when you\u2019re having a good time, things can change in an instant. Already a longtime self-isolator so that part won\u2019t be hard \ud83d\ude18 I\u2019ll continue posting and staying connected with you each day. \nThe impact will be strong for many musicians, independent contractors, workers of all types,families, young students and so on - here\u2019s to all of you making it through ok too\ud83d\ude4f\ud83c\udffd .. Ps..stop buying up all the TP (lol) keep a sense of humor.. don\u2019t lose sight of kindness when you\u2019re in the stores stocking up on food and necessities, stay diligent but calm.. and please don\u2019t forget elderly relatives, donate to programs that will continue to provide for children who may not have food now that there is no school at the moment.. Love to all \u2764\ufe0f\ud83e\udd17 \u2014ALWAYS  find the light through the darkness. Wattage \u2728 #JodyWatley \ud83d\udcf8 by Sneakshot Photography \n2.08.20\nWashington D.C. \nThe Howard Theatre \ud83d\udd25\ud83c\udfb6\ud83c\udfa4\ud83c\udfab #jodywatley #life #people #music #reboot  #rejuvenation #livemusic - #regrann"}}]},"shortcode":"B9xf8fgAlD5","edge_media_to_comment":{"count":0},"taken_at_timestamp":1584316393,"dimensions":{"height":1080,"width":1080},"display_url":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/e35/89946043_2598838410436111_797598654570709444_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=107\u0026_nc_ohc=F_4-R5eyXXAAX_ro_Qa\u0026oh=fb37ba6d48989941c222e7b23fc6b51e\u0026oe=5EA2EE6D","edge_liked_by":{"count":0},"edge_media_preview_like":{"count":0},"owner":{"id":"509988003"},"thumbnail_src":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/sh0.08/e35/s640x640/89946043_2598838410436111_797598654570709444_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=107\u0026_nc_ohc=F_4-R5eyXXAAX_ro_Qa\u0026oh=09c359ff68f857b8812a9fc56f1320c3\u0026oe=5EA53788","thumbnail_resources":[{"src":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/e35/s150x150/89946043_2598838410436111_797598654570709444_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=107\u0026_nc_ohc=F_4-R5eyXXAAX_ro_Qa\u0026oh=8a9fb777628ebedee4f1486ce2f4af05\u0026oe=5EA67E2F","config_width":150,"config_height":150},{"src":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/e35/s240x240/89946043_2598838410436111_797598654570709444_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=107\u0026_nc_ohc=F_4-R5eyXXAAX_ro_Qa\u0026oh=76a3868030f5cb7da414f00f26fd241d\u0026oe=5EA36165","config_width":240,"config_height":240},{"src":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/e35/s320x320/89946043_2598838410436111_797598654570709444_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=107\u0026_nc_ohc=F_4-R5eyXXAAX_ro_Qa\u0026oh=18d361dc4d680950da603f34d7b77154\u0026oe=5E9D8BDF","config_width":320,"config_height":320},{"src":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/e35/s480x480/899 dera-se melhor do que o seu pr\u00f3ximo com base na sua cor, bens, orienta\u00e7\u00e3o sexual, religi\u00e3o, g\u00eanero ou o que for, as not\u00edcias para voc\u00ea n\u00e3o s\u00e3o nada agrad\u00e1veis.\n.\nTudo o que desrespeito a vida particular do outro \u00e9 somente problema do outro, n\u00f3s como terceiros devemos apenas respeitar, afinal, tudo come\u00e7a e se desenvolve pelo respeito.\n.\nEnquanto n\u00e3o entendermos que somos todos iguais, indiferente de quaisquer aspectos f\u00edsicos, materiais e/ou psicol\u00f3gicos, a humanidade crescer\u00e1 apenas em n\u00famero, sem evolu\u00e7\u00e3o.\n.\nComo disse J. K. Rowling em Harry Potter: \u201cEstamos vivendo tempos de insanidade, loucos!\u201d\n\u2014\u2014\n#different #society #quotes #writer #pinterest"}}]},"shortcode":"B9xfRKuJmtC","edge_media_to_comment":{"count":1},"taken_at_timestamp":1584316038,"dimensions":{"height":640,"width":640},"display_url":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/e35/89735800_198874458070868_4789532200357900588_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=108\u0026_nc_ohc=EtYlRr-ZLcsAX_sO9Pl\u0026oh=52fcd5c354d186cfbbb31e4d947e952b\u0026oe=5EA2C79F","edge_liked_by":{"count":0},"edge_media_preview_like":{"count":0},"owner":{"id":"22720468124"},"thumbnail_src":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/e35/89735800_198874458070868_4789532200357900588_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=108\u0026_nc_ohc=EtYlRr-ZLcsAX_sO9Pl\u0026oh=52fcd5c354d186cfbbb31e4d947e952b\u0026oe=5EA2C79F","thumbnail_resources":[{"src":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/e35/s150x150/89735800_198874458070868_4789532200357900588_n.jpg?_nc_ht=scontent-sjc3-1.cdninstagram.com\u0026_nc_cat=108\u0026_nc_ohc=EtYlRr-ZLcsAX_sO9Pl\u0026oh=4c6eff9be34d39f3950236726d7aa35e\u0026oe=5EA4F0DD","config_width":150,"config_height":150},{"src":"https://scontent-sjc3-1.cdninstagram.com/v/t51.2885-15/e35/s240x240/89735800_19887445
